import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'TrafficFlowAi';
}
<div class="header">
  <a class="logo">
    TrafficFlowAI
  </a>
  <div class="nav-list">
    <div class="nav-list-item">
      <a class="nav-list-item-link" routerLink="">
        Contacts
      </a>
    </div>
    <a class="try-it" routerLink="">Try it!</a>

  </div>
</div>
<router-outlet></router-outlet>
